import { useNavigate } from 'react-router-dom';
const Logout = () => {
    // window.sessionStorage.clear();
    window.addEventListener('beforeunload', function (e) {
        sessionStorage.clear();
    });
    const navigate = useNavigate();
    navigate('/')
    return (
        <div>

        </div>
    )
}

export default Logout
